(function ($) {

    Drupal.ajax.prototype.commands.add_success_message = function (ajax, response, status) {
        $('.ask-form').append(response.success);
        $('.webform-client-form-11')[0].reset();

        if(!response.modal){
            setTimeout(function () {
                $('.ask-form .success-block').remove();
            }, 5000);
        }
    };

    Drupal.ajax.prototype.commands.contact_us_success = function (ajax, response, status) {
        $('.form-contact-us').addClass('send-success');

        $('.webform-client-form-155').find("input[type=text], input[type=email], textarea").val("");
        $('.webform-client-form textarea').val("Hello DA-14 team. I'd like to share my project idea with you.");
        $('.webform-component--country select').find('option:selected').removeAttr('selected');
        $('.webform-component--phone input').prop('disabled', true).attr('placeholder', '  Phone');
        $('.selected-dial-code').html('');
        $('#edit-submitted-prefer-to-call-1').removeAttr("checked");
    };

    Drupal.ajax.prototype.commands.modal_dialog = function (ajax, response, status) {
        var popup = new Foundation.Reveal($('#popup-modal-ask-form'));
        $('#popup-modal-ask-form .webform-client-form-11, #popup-modal h2').remove();
        $('#popup-modal-ask-form .modal-wrapper').empty();
        $('#popup-modal-ask-form .modal-wrapper').append(response.title + response.form);
        if (response.email) {
          $('#popup-modal-ask-form .modal-wrapper input[type="email"]').val(response.email);
        }
        
        Drupal.attachBehaviors(response.form);
        popup.open();
    };

    Drupal.behaviors.contactsUs = {
        attach: function (context ,settings) {
            var $form = $("form#webform-client-form-155", context);
            var $submitButton = $('.webform-submit', $form);
            $form.attr('novalidate', true);
            $form
                .once('contactsUs')
                .off('submit')
                .on('submit', function(e){
                    e.preventDefault();

                    var $nameField =  $('.webform-component--name input').removeClass('error'),
                        $emailField =  $('.webform-component--email input').removeClass('error'),
                        $countryField = $('.webform-component--country select').removeClass('error'),
                        $phoneField = $('.webform-component--phone input').removeClass('error'),
                        emailRegExp = /^([A-z0-9_\.-]+)@([A-z0-9_\.-]+)\.([A-z\.]{2,6})$/;

                    if ($emailField.val() === '' || !emailRegExp.test($emailField.val())) {
                        $emailField.addClass('error');
                    }

                    if ($nameField.val() === '') {
                        $nameField.addClass('error');
                    }

                    if ($('#edit-submitted-prefer-to-call-1').is(":checked")) {
                        if ($countryField.val() === '') {
                            $countryField.addClass('error');
                        }

                        if ($phoneField.val() === '') {
                            $phoneField.addClass('error');
                        }
                    }

                    if($form.find('.error').length === 0) {
                        $submitButton.trigger('submitContactsUs');
                    }
                });
        }
    };
    

    /** remove class .send-success **/
    $('#contactUsBtnOk').on('click touchstart', function () {
        $('.form-contact-us').removeClass('send-success');
    });

    //Check if empty input add class
    $('.webform-client-form input').focus(function() {
        $(this).addClass('not-empty');
    });

    $('.webform-client-form textarea').focus(function() {
        var $this = $(this);
        if ($this.val() == "Hello DA-14 team. I'd like to share my project idea with you.") {
            $this.val('');
        }
    });


    $('.webform-client-form input').blur(function() {
        if ($(this).val() == '') {
            $(this).removeClass('not-empty');
        }
    });

    $('.webform-client-form textarea').blur(function() {
        var $this = $(this);
        if ($this.val() == '') {
            $this.val("Hello DA-14 team. I'd like to share my project idea with you.");
        }
    });

    var $webForm = $('#webform-client-form-155');

    $webForm.find('#edit-submitted-prefer-to-call-1').change(function() {
        if($(this).is(":checked")) {
            if ($webForm.find('#edit-submitted-phone').prop('disabled')) {
                $webForm.find('#edit-submitted-phone').attr('placeholder', '* Phone');
            }
            $webForm.find('#edit-submitted-country').find('option').first().text('* Country');
        }
        else {
            if ($webForm.find('#edit-submitted-phone').prop('disabled')) {
                $webForm.find('#edit-submitted-phone').attr('placeholder', '  Phone');
            }
            $webForm.find('#edit-submitted-country').find('option').first().text('  Country');
        }
    });

    // Phone formats
    var countryData = $.fn.intlTelInput.getCountryData(),
        $countryField = $webForm.find('.webform-component--country select'),
        $phoneField = $webForm.find('.webform-component--phone input'),
        countryList = [],
        globalData = {};
    $.each(countryData, function(i, country) {
        //country.name = country.name.replace(/.+\((.+)\)/,"$1");
        countryList.push({
            label: country.name,
            value: country.iso2,
            dialCode: country.dialCode,
            priority: country.priority,
            areaCodes: country.areaCodes
        });
    });
    $phoneField.intlTelInput({
        allowDropdown: false,
        initialCountry: "auto",
        separateDialCode: true,
        utilsScript: "/sites/all/modules/custom/da_webform/utils.js",
        autoPlaceholder: "aggressive",
        customPlaceholder: function(selectedCountryPlaceholder, selectedCountryData) {
            globalData.placeholder = selectedCountryPlaceholder;
            globalData.mask = selectedCountryPlaceholder.replace(/[0-9]/g, "0");
            globalData.maskPlaceholder = selectedCountryPlaceholder.replace(/[0-9]/g, "_")

            //return "+" + selectedCountryData.dialCode;
        },

        // autoHideDialCode: false,
        // autoPlaceholder: "off",
        // dropdownContainer: "body",
        // excludeCountries: ["us"],
        // formatOnDisplay: false,
        // geoIpLookup: function(callback) {
        //   $.get("http://ipinfo.io", function() {}, "jsonp").always(function(resp) {
        //     var countryCode = (resp && resp.country) ? resp.country : "";
        //     callback(countryCode);
        //   });
        // },
        // nationalMode: false,
        // onlyCountries: ['us', 'gb', 'ch', 'ca', 'do'],
        // placeholderNumberType: "MOBILE",
        // preferredCountries: ['cn', 'jp'],

    });

    $phoneField.prop( "disabled", true );

    $phoneField.on("countrychange", function(e, countryData) {
        if(countryData.dialCode) {
            $phoneField.prop( "disabled", false );
            $phoneField.attr('placeholder', globalData.maskPlaceholder);
            var options =  {
                placeholder: globalData.maskPlaceholder,
            };
            $phoneField.mask(globalData.mask, options);
        }else {
            var placeholder = '  Phone';
            if($webForm.find('#edit-submitted-prefer-to-call-1').is(':checked')){
              placeholder = '* Phone';
            }
            $phoneField.val('');
            $phoneField.attr('placeholder', placeholder);
            $phoneField.attr('maxlength', 128);
            $phoneField.prop( "disabled", true );
        }
    });

    // $countryField.autocomplete({
    //     minLength: 2,
    //     source: countryList,
    //     focus: function( event, ui ) {
    //         $countryField.val( ui.item.label);
    //         $phoneField.attr('maxlength', 128);
    //         return false;
    //     },
    //     select: function( event, ui ) {
    //         $countryField.val( ui.item.label );
    //         $phoneField.intlTelInput("setCountry", ui.item.value);
    //         return false;
    //     },
    //     change: function( event, ui ) {
    //         if(ui.item) {
    //             $countryField.val( ui.item.label );
    //             $phoneField.intlTelInput("setCountry", ui.item.value);
    //         }else {
    //             var countryData = $phoneField.intlTelInput("getSelectedCountryData");
    //             if(countryData.name) {
    //                 $countryField.val(countryData.name);
    //             }else {
    //                 $countryField.val('');
    //                 $phoneField.intlTelInput("setCountry", '');
    //             }
    //         }
    //
    //         return false;
    //     }
    // });
  
    $countryField.on('change', function(e){
       e.preventDefault();
      
       $phoneField.intlTelInput("setCountry", $(this).val());
    });

    // // Prevent send wrong country name
    // $('#webform-client-form-155 .webform-submit').on('mousedown', function(e) {
    //     $countryField.val($phoneField.intlTelInput("getSelectedCountryData").name);
    // });


}(jQuery));
